import {useEffect, useState} from "react";
import Test_list from "./Test_list";

export default function Test() {
    const [list, setList] = useState('');

    useEffect(() => {
        fetch('api/cars')
            .then(element => element.json())
            .then(element => setList(element));
    }, []);


    return (
        <div className="Test">
            <div>
                {
                    list.map((car) => (
                        <Test_list key={car.id} {...car} />
                    ))
                }
            </div>
        </div>
    )
}
